The purpose of this PQQ (Stage 1) is to obtain sufficient information to enable Red Cross to evaluate the suitability of Tenderers to meet its requirements, as outlined within the attached PQQ Document, with the view to shortlisting 3 suitably qualified and experienced Tenderers who then will be issued an Invitation to Tender (Stage 2) and invited to submit a formal proposal that meets Red Cross' specific requirements.
The conclusion of this two stage Tender shall enable Red Cross to award a Contract to the Tenderer who has demonstrated sufficient experience, capability and capacity to deliver the hosted data centre solution and has illustrated the ability to work as a strategic partner that shall enable our organisation to meet its Corporate Strategy objectives.
The indicative Services required under this Contract include, but are not limited to:
* Provision of co-location hosted data centre services;
* Provision of design services;
* Provision of migration support services;
* On-going monitoring of the hosted environment; and
* All other associated services.
Please refer to the attached PQQ Document and PQQ Submission for further information.

Defence Commercial C&C, part of the United Kingdom Ministry of Defence (the ‘Authority’), has placed a 2 core plus 1 option course intake (see below) contract with Kings College London (‘KCL’) for vocational education services for the provision of Online Distance Learning in MA Air Power Studies.

A 2 Core plus 1 Option Course Intake contract covering the following periods:

— Intake 1 — September 2016 to February 2019;

— Intake 2 — September 2017 to February 2020;

— Option Intake 3 — September 2018 to February 2021.

It is considered that this contract can be placed using the negotiated procedure without prior publication of a contract notice pursuant to Article 32(2)(a) of Directive 2014/24/EU of the European Parliament and of the Council (Regulation 32(2)(a) of the UK Public Contracts Regulations 2015). An advert was placed in the OJEU on the 2.2.2016 (Ref: 2016/S 022-035221) and the Authority proceeded to run a competition under the restricted procedure. However, no tenders were submitted on the Tender Return Date. The Authority therefore has awarded a 2 core plus 1 option course intake contract to KCL, the current course provider. The Authority intends to commence a further competition in the near future which will invite interested tenderers to design, develop and deliver an online distance learning MA in air power.
